        var bigint = parseInt(hex.substr(1), 16);
        var r = (bigint >> 16) & 255;
        var g = (bigint >> 8) & 255;
        var b = bigint & 255;
        var colorArr  = [r, g, b] ;
        return colorArr; 
    } else {
        return [0,0,0];
    }
}

